import React from 'react'

function Result(props) {
    console.log(props);
  return (
    <div>
        <div>Hi {props.Name}. Wir haben deine Bestellung erhalten</div>
        <div>Hamburger: {props.Hamburger} Cola: {props.Cola} {props.Hamburger}</div>
    </div>
  )
}

export default Result
